syntax "proto3";

package aws;

message AwsLb {
  access_logs = 1;
  arn = 2;
  arn_suffix = 3;
  dns_name = 4;
  drop_invalid_header_fields = 5;
  enable_deletion_protection = 6;
  id = 7;
  idle_timeout = 8;
  internal = 9;
  load_balancer_type = 10;
  name = 11;
  security_groups = 12;
  subnet_mapping = 13;
  subnets = 14;
  tags = 15;
  vpc_id = 16;
  zone_id = 17;
}